import Snake from "./Snake";

class Point {
  private xcoord: number;
  private ycoord: number;
  constructor() {
    this.xcoord = 0;
    this.ycoord = 0;
  }
  public get position() {
    return this.xcoord;
    return this.ycoord;
  }
}

export default Point;
